import React from 'react';
import Hero from '../components/Hero';
import Navbar from '../components/Navbar';


function Home() {
  return (
    <div>
      <Navbar />
      <Hero
        cName="hero"
        buttonText="Grow your business with us"
        url="/"
        btnClass="show"
      />
      <h2 style={{ color: '#632020', padding: '0.5rem', textAlign: 'center' }}>
        Our Services
      </h2>
      <p>We are ready to scale up your business with our great team.</p>
      <CCard>
  <CCardBody>This is some text within a card body.</CCardBody>
</CCard>
    </div>
  );
}

export default Home;
